@Override
protected BytesRef copyDocGroupValue(BytesRef groupValue, BytesRef reuse) {
  if (groupValue == null) {
    return null;
  } else if (reuse != null) {
    reuse.copy(groupValue);
    return reuse;
  } else {
    return new BytesRef(groupValue);
  }
}

